import {useState, useEffect} from 'react';
import axios from "axios";

const useFetch = (url) => {
    const [data, setData] = useState(null);

    useEffect(()=>{
        axios({
            method: 'get',
            url: url,
            headers: {
                "Content-Type": "application/json"
            }
        }).then((res)=>{console.log("res",res.data)});
    }, [url]);

    return [data];
}

export default useFetch;
